ты  55*85,55*42,5(см) (латекс безопасность)", "Vonaldi"], "88": ["Отличный коврик!!!", "2021-04-05T17:15:11Z", "кремовый", "0", 1, 1, 5, "Набор ковриков противоскользящих для ванной комнаты  55*85,55*42,5(см) (латекс безопасность)", "Vonaldi"], "91": ["Как на фото. Рекомендую.", "2021-04-03T17:01:09Z", "светло-коричневый", "0", 1, 0, 5, "Набор ковриков противоскользящих для ванной комнаты  55*85,55*42,5(см) (латекс безопасность)", "Vonaldi"], "92": ["Хорошие коврики не скользят, мягкие,по размеру подошли.", "2021-04-03T16:44:56Z", "светло-коричневый", "0", 0, 1, 5, "Набор ковриков противоскользящих для ванной комнаты  55*85,55*42,5(см) (латекс безопасность)", "Vonaldi"], "104": ["Хорошие коврики!", "2021-03-31T03:17:10Z", "фисташковый", "0", 1, 0, 5, "Набор ковриков противоскользящих для ванной комнаты  55*85,55*42,5(см) (латекс безопасность)", "Vonaldi"], "106": ["Очень классные, мягкие коврики для ванны и туалета. Рекомендую к покупке.", "2021-03-30T14:46:01Z", "светло-бежевый", "0", 1, 0, 5, "Набор ковриков противоскользящих для ванной комнаты  55*85,55*42,5(см) (латекс безопасность)", "Vonaldi"], "110": ["Белые красивые, и что очень удивительно, в белых ковриках не особо видно мусора, пока веником не пройдёшься или встряхнешь ", "2021-03-28T08:59:33Z", "", "0", 1, 0, 5, "Набор ковриков противоскользящих для ванной комнаты  55*85,55*42,5(см) (латекс безопасность)", "Vonaldi"], "114": ["белые очень красивые!", "2021-03-23T13:09:57Z", "", "0", 1, 0, 5, "Набор ковриков противоскользящих для ванной комнаты  55*85,55*42,5(см) (латекс безопасность)", "Vonaldi"], "115": ["Белые, не тонкие. Вроде хорошие коврики", "2021-03-23T08:57:36Z", "", "0", 1, 0, 5, "Набор ковриков противоскользящих для ванной комнаты  55*85,55*42,5(см) (латекс безопасность)", "Vonaldi"], "116": ["Первый раз заказала на этом сайте, я в восторге очень понравился и по размеру и по качеству класс", "2021-03-21T15:29:58Z", "", "0", 1, 0, 5, "Набор ковриков противоскользящих для ванной комнаты  55*85,55