рики,не скользят", "2021-02-01T11:09:36Z", "светло-бежевый", "0", 1, 0, 5, "Набор ковриков противоскользящих для ванной комнаты  55*85,55*42,5(см) (латекс безопасность)", "Vonaldi"], "215": ["Коврики прекрасные. Описанию соответствуют. К покупке рекомендую.", "2021-01-26T19:40:10Z", "зеленый", "0", 1, 0, 5, "Набор ковриков противоскользящих для ванной комнаты  55*85,55*42,5(см) (латекс безопасность)", "Vonaldi"], "216": ["Товар пришел целый. Коврики очень понравились. Мягкие, не скользят. Свою функцию выполняют на 100 процентов. Спасибо магазину и поставщику.", "2021-01-26T12:05:48Z", "синий", "0", 1, 0, 5, "Набор ковриков противоскользящих для ванной комнаты  55*85,55*42,5(см) (латекс безопасность)", "Vonaldi"], "217": ["Понравились коврики, мягкие, приятно вставать ногами и размер хороший.", "2021-01-25T17:22:55Z", "кремовый", "0", 1, 0, 5, "Набор ковриков противоскользящих для ванной комнаты  55*85,55*42,5(см) (латекс безопасность)", "Vonaldi"], "218": ["Коврики отличные, уже стирала в машинке на деликатной стирке, ничего не изменилось. ", "2021-01-25T07:08:19Z", "кремовый", "0", 2, 0, 5, "Набор ковриков противоскользящих для ванной комнаты  55*85,55*42,5(см) (латекс безопасность)", "Vonaldi"], "234": ["Отличный набор! Качество хорошее,не тонкий.Цвет правда не соответствует цвету на фото.Но для меня это было не критично, цвет подошёл.Спасибо wb.Рекомендую.", "2021-01-08T18:19:48Z", "голубой", "0", 1, 0, 5, "Набор ковриков противоскользящих для ванной комнаты  55*85,55*42,5(см) (латекс безопасность)", "Vonaldi"], "238": ["товар хороший, нитки не торчат, строчки ровные, приветствует не значительный запах, думаю выветрится, доволен покупкой, советую", "2021-01-05T18:07:51Z", "розовый, бежевый, розовая фуксия", "0", 1, 0, 5, "Набор ковриков противоскользящих для ванной комнаты  55*85,55*42,5(см) (латекс безопасность)", "Vonaldi"], "239": ["Классный набор ковриков, спасибо продавцу) ", "2021-01-04T17:53:21Z", "оранжевый", "0", 1, 0, 5, "Набор ковриков противоскользящих для ванной комнаты  55*85,55*42,5(см) (латекс безопасность)", "Vonaldi"], "244": ["Коврик мягкий,приятный очень)", "2021-01-01T14:51:27Z", "шоколадный, бежевый", "0", 1, 0, 5, "Набор ковриков противоскользящих для ванной комнаты  55*85,55*42,5(см) (латекс безопасность)", "Vonaldi"], "249": ["Отличные коврики,мякгие и теплые!", "2020-12-29T15:23:49Z", "голубой", "0", 3, 0, 5, "Набор ковриков противоскользящих для ванной комнаты  55*85,55*42,5(см) (латекс безопасность)", "Vonaldi"], "252": ["Приятные для ног и качественные", "2020-12-28T15:40:41Z", "синий", "0", 1, 0, 5, "Набор ковриков противоскользящих для ванной комнаты  55*85,55*42,5(см) (латекс безопасность)", "Vonaldi"], "254": ["Коврики в целом очень хорошие, мягкие, резиновая подложка качественная. Стирку в машине и сушку на обогревателе выдержали отлично. Только два минуса: довольно сильный полутухлый запах(( К счастью, после стирки (пришлось запустить её сразу же) - запах ушёл. И второе - очень лезет. На фото только малая часть -  таких роликов, в три раза более залипших, было штук 5. Надеюсь, потихоньку пройдёт. И плюс вырез под унитаз всё-таки великоват.", "2020-12-27T19:02:23Z", "синий", "0", 2, 3, 4, "Набор ковриков противоскользящих для ванной комнаты  55*85,55*42,5(см) (латекс безопасность)", "Vonaldi"], "255": ["Отличные коврики ", "2020-12-27T18:16:00Z", "", "0", 1, 0, 5, "Набор ковриков противоскользящих для ванной комнаты  55*85,55*42,5(см) (латекс безопасность)", "Vonaldi"], "259": ["Коврики  отличные ,белоснежный цвет, не скользит.", "2020-12-26T17:07:57Z", "", "0", 1, 0, 5, "Набор ковриков противоскользящих для ванной комнаты  55*85,55*42,5(см) (латекс безопасность)", "Vonaldi"], "263": ["Коврики мягонькие,  выходишь из ванны или сидишь на унитазе, ножкам приятно.", "2020-12-24T05:20:46Z", "серый, графит, бежевый", "0", 2, 0, 5, "Набор ковриков противоскользящих для ванной комнаты  55*85,55*42,5(см) (латекс безопасность)", "Vonaldi"], "268": ["Коврики просто прелесть!!! Смотрела такие в магази