е, откуда он взялся, непонятно. При этом они ещё и дико кривые. Один плюс - они мягкие и не скользят. В остальном разочарование.", "2020-12-06T15:27:03Z", "бежевый, светло-коричневый", "0", 4, 0, 3, "Набор ковриков противоскользящих для ванной комнаты  55*85,55*42,5(см) (латекс безопасность)", "Vonaldi"], "289": ["Коврики хорошие. Материал синтетика. Размеры соответствуют.", "2020-12-06T12:25:49Z", "кремовый", "0", 1, 0, 5, "Набор ковриков противоскользящих для ванной комнаты  55*85,55*42,5(см) (латекс безопасность)", "Vonaldi"], "292": ["Спасибо,хороший набор ковриков!", "2020-11-30T12:52:25Z", "фисташковый", "0", 1, 0, 5, "Набор ковриков противоскользящих для ванной комнаты  55*85,55*42,5(см) (латекс безопасность)", "Vonaldi"], "293": ["Очень качественные, размер хороший ", "2020-11-27T10:30:03Z", "бежевый, светло-коричневый", "0", 1, 0, 5, "Набор ковриков противоскользящих для ванной комнаты  55*85,55*42,5(см) (латекс безопасность)", "Vonaldi"], "295": ["Нормальный набор  ковриков , был бы, если бы не часть для ног  . Очень узкий коврик , ноги не возможно поставить если его в плотную к унитазу подвинуть.", "2020-11-25T11:26:31Z", "голубой", "0", 1, 0, 4, "Набор ковриков противоскользящих для ванной комнаты  55*85,55*42,5(см) (латекс безопасность)", "Vonaldi"], "296": ["Сегодня по стирала в машинке на 40°,после отжима и просушки выглядит как новый. Рекомендую !", "2020-11-24T12:59:43Z", "темно-голубой, королевский синий, молочный", "0", 5, 0, 5, "Набор ковриков противоскользящих для ванной комнаты  55*85,55*42,5(см) (латекс безопасность)", "Vonaldi"], "298": ["Отличный, качественный, хорошо впитывает.не скользит. Приятный цвет", "2020-11-15T11:20:06Z", "кремовый", "0", 0, 1, 5, "Набор ковриков противоскользящих для ванной комнаты  55*85,55*42,5(см) (латекс безопасность)", "Vonaldi"], "309": ["Отличные коврики, подошли", "2020-08-20T10:46:15Z", "светло-коричневый", "0", 1, 3, 5, "Набор ковриков противоскользящих для ванной комнаты  55*85,55*42,5(см) (латекс безопасность)", "Vonaldi"], "312": ["Прекрасные коврики! Покупала за 716 р.", "2020-09-18T16:31:34Z", "фиолетовый", "0", 3, 0, 5, "Набор ковриков противоскользящих для ванной комнаты  55*85,55*42,5(см) (латекс безопасность)", "Vonaldi"], "316": ["Мне понравились,стирку пережили на ура.", "2020-09-16T19:22:38Z", "шоколадный, бежевый", "0", 2, 0, 5, "Набор ковриков противоскользящих для ванной комнаты  55*85,55*42,5(см) (латекс безопасность)", "Vonaldi"], "317": ["Качественные коврики. Размер соответствующий. Цвет тоже. Заказывала белые.", "2020-09-16T16:28:46Z", "", "0", 1, 0, 5, "Набор ковриков противоскользящих для ванной комнаты  55*85,55*42,5(см) (латекс безопасность)", "Vonaldi"], "327": ["Хорошие коврики. Пришёл заявленный шоколадный цвет. Покупала для мамы, она довольна ", "2020-09-11T15:11:42Z", "шоколадный, бежевый", "0", 1, 0, 5, "Набор ковриков противоскользящих для ванной комнаты  55*85,55*42,5(см) (латекс безопасность)", "Vonaldi"], "334": ["Классные коврики, мягкие, не скользят👍", "2020-09-06T12:17:05Z", "оливковый, светло-зеленый, молочный", "0", 1, 0, 5, "Набор ковриков противоскользящих для ванной комнаты  55*85,55*42,5(см) (латекс безопасность)", "Vonaldi"], "335": ["Мне понравился! Мягкий, не пахнет. Выглядит хорошо. Цвет соответствует.", "2020-08-12T15:51:28Z", "оливковый, светло-зеленый, молочный", "0", 1, 0, 5, "Набор ковриков противоскользящих для ванной комнаты  55*85,55*42,5(см) (латекс безопасность)", "Vonaldi"], "337": ["Коврики отличного качества. Цвет соответствует заявленному.", "2020-09-03T08:47:22Z", "бордовый, бежевый", "0", 0, 1, 5, "Набор ковриков противоскользящих для ванной комнаты  55*85,55*42,5(см) (латекс безопасность)", "Vonaldi"], "340": ["Коврик нормальный, но маленький коврик для унитаза совсем короткий. Если сидеть и нормально ноги поставить, то ступни не будут лежать на коврике.", "2020-08-29T13:13:45Z", "кремовый", "0", 2, 0, 3, "Набор ковриков противоскользящих для ванной комнаты  55*85,55*42,5(см) (латекс безопасность)", "Von